(8, '22820327', 'O', ' INSPECTORIA: SE CONVEERSA CON ALUMNA Y SE COMPROMETE A LLEGAR A LA HIORA. SE LE INFORMA DE SU TERCER ATRASO. PROXOIMO ATRASO SE IRA SUSPENDIDA', '2024-03-06', NULL, '09:57:56', 4, NULL),
