(15, '21377619', 'P', 'JEFATURA: ALUMNA QUE COOPERA CON ARTICULOS PARA ALUMNA QUE SUFRIO INCENDIO', '2024-03-25', NULL, '09:06:59', 15, NULL),
(16, '22517591', 'P', 'JEFATURA: ALUMNA QUE COOPERA CON ALIMENTOS PARA ALUMNA QUE SUFRIO INCENDIO', '2024-03-25', NULL, '09:12:13', 16, NULL),
(17, '22775021', 'N', 'MATEMATICAS. Alumno que llega sin su tarea de la asignatura', '2024-03-20', NULL, '14:47:23', 6, 'L'),
(18, '22775021', 'N', 'PROFESOR JEFE : Alumno que ha estado toda la mañana en su celular, sin realizar sus ejercicios, se le dice que se llamará a su mamá para que lo envíe sin celular a pesar de llamarle la atención y decirle eso, él sigue con su teléfono jugando y \"no\" realizando ninguna tarea en la clase.', '2024-03-22', NULL, '14:51:31', 6, 'L'),
(19, '22775021', 'P', 'PROFESOR JEFE. Alumno que trae cooperación para el curso y para la alumna afectada por el incendio.', '2024-03-25', NULL, '14:53:03', 6, 'GMA'),
(20, '22775021', 'N', 'PROFESOR JEFE. Estudiante sigue utilizando su celular y conversando en sala a pesar de haberle llamado la atención varias veces, se le pide que salga de la sala.', '2024-06-03', NULL, '14:54:17', 6, 'L'),
(21, '100720721', 'P', 'PROFESOR JEFE. Alumna que trae cooperación para el curso y alumna que se le quemó su casa.', '2024-03-25', NULL, '14:58:06', 9, NULL),
(22, '100720716', 'P', 'PROFESOR JEFE. Alumno que coopera con útiles de aseo para la sala y para la estudiante que se le quemó la casa.', '2024-03-25', NULL, '14:59:25', 7, NULL),
(23, '16241682', 'P', 'PROFESOR JEFE. Estudiante que coopera con confort para la sala y alimentos para la estudiante que se le quemó la casa', '2024-03-25', NULL, '15:00:28', 14, NULL),
(24, '16241682', 'N', 'PROFESOR JEFE. Alumna que por 4 vez sale de la sala a contestar el celular sin pedir permiso, antes lo había hecho y se lo había dicho, que pidiera permiso para salir a contestar y no obedece, se envía a inspectoría y se da aviso.', '2024-06-17', NULL, '15:01:51', 14, 'L'),
(25, '22820327', 'P', 'PROFESOR JEFE. Alumna que coopera con confort para la sala,', '2024-03-25', NULL, '15:04:33', 4, NULL),
(26, '22820327', 'O', 'INSPECTOR GENERAL. Se conversa con alumna y se compromete a llegar a la hora. Se le informa que es su tercer atraso y el próximo se tendrá que suspender.', '2024-03-26', NULL, '15:05:45', 4, NULL),
(27, '100742748', 'P', 'PROFESOR JEFE. Estudiante que coopera con plantita para la sala y aseo de la misma.', '2024-03-25', NULL, '15:07:46', 3, NULL),
(28, '22733775', 'P', 'PROFESOR JEFE. Alumno que coopera para la estudiante que sufrió incendio.', '2024-03-25', NULL, '15:08:44', 8, NULL),
(29, '22733775', 'N', 'PROFESOR JEFE. Estudiante conversa y utiliza celular en sala se le habla varias veces y no obedece, se le pide que abandone la sala.', '2024-06-03', NULL, '15:09:43', 8, 'L'),
(30, '21127982', 'P', 'PROFESOR JEFE. Alumna que duranre la semna coopera con aseo de la sala.', '2024-05-23', NULL, '15:11:12', 11, NULL),
(31, '21127982', 'N', 'ESTUDIOS SOCIALES. Estudiante que no realiza su guía de trabajo, la entrega en blanco, interrumpe el trabajo de los demás usando su celular, se le pide que use audifonos a lo que responde \"lamentablemente no tengo\". Esta estudiante tiene conflicto con la autoridad del docente en la sala de clases ya que pide permiso para retirarse a lo cual se le da el permiso pero igual sale de la sala de clases ', '2024-04-08', NULL, '15:12:18', 11, 'L'),
(32, '21127982', 'N', 'LENGUAJE. Alumna que responde entre dientes a la Profesora Verónica Fuentes. luego sale de la sala sin permiso, se va al patio, vuelve a la sala a sacar su mochila, sale empuja la mesa y le dice a la profesora vero vieja culia y se va, el inspector va tras ella.', '2024-04-26', NULL, '15:15:55', 11, 'G'),
(33, '21127982', 'N', 'INSPECTOR GENERAL. Alumna se fuga del establecimiento y se deja registro de sus acción en el libro de salida. Se le citará para notificar suspensión.\r\nSe cita a la alumna y se le notifica su suspensión de 3 días, Puede regresar a clases el día 06 de mayo del 2024', '2024-04-26', NULL, '15:18:32', 11, 'G'),
(34, '21377619', 'P', 'PROFESOR JEFE. Alumna que coopera con articulos para alumna que sufrió incendio.', '2024-03-25', NULL, '15:22:10', 15, NULL),
(35, '22517591', 'P', 'PROFESOR JEFE. Alumno que coopera con alimentos para la estudiante qye sufrió incendio.', '2024-03-25', NULL, '15:23:02', 16, NULL),
(41, '26152910', 'O', 'INSPECTOR GENERAL : Se le comunica al alumno de sus tres atrasos se le reitera que el RICE esta contemplado como una falta. Alumno se compromete a llegar mas temprano o a la hora.', '2024-04-30', NULL, '15:42:21', 87, NULL),
(42, '26152910', 'N', 'MATEMÁTICAS: Estudiante es sorprendido copiando la evaluación desde un video en su celular. Obtiene la nota mínima 1.0.', '2024-05-28', NULL, '15:48:46', 87, 'L'),
(43, '26152910', 'N', 'LENGUAJE: Estudiante utiliza una historia ya existente en la evaluación de creación de cuento donde se pedía originalidad, por esto obtiene nota mínima 1.0', '2024-06-11', NULL, '15:50:21', 87, 'L'),
(44, '22563597', 'N', 'INGLÉS: El alumno no realiza las actividades que se dan en clases, no participa de la clase, se dedica a jugar con el celular. Se le pide en reiteradas ocasiones que lo guarde y nada.', '2024-04-23', NULL, '15:52:58', 105, 'L'),
(45, '22563597', 'O', 'INGLÉS: Al alumno se le da una segunda oportunidad para terminar guía de ejercicios evaluados para el día viewrnes 26/04/24 para mejorar nota.', '2024-04-23', NULL, '15:54:58', 105, NULL),
(46, '22563597', 'N', 'MATEMÁTICAS: Estudiante no realiza la actividad de clase, a pesar de las indicaciones de la profesora.', '2024-05-15', NULL, '15:56:41', 105, 'L'),
(47, '22563597', 'O', 'INGLÉS: Al alumno se le dio una nueva oportunidad para rendir guía de ejercicios del 26/04/24 y no la dio por lo que se le calificará con nota 1.0-', '2024-05-17', NULL, '15:58:07', 105, NULL),
(48, '22563597', 'N', 'CIENCIAS NATURALES: Estudiante que no trabaja en clases, se dedica a conversar y estar con su celular toda la hora.', '2024-05-22', NULL, '16:00:13', 105, 'L'),
(49, '22563597', 'O', 'CIENCIAS NATURALES : Estudiante se compromete a presentar cuaderno de ciencias para su revisión el día 13/06, de no ser así se calificará con nota mínima.', '2024-06-12', NULL, '16:01:49', 105, NULL),
(50, '22563597', 'O', 'INGLÉS: Al alumno se le informa que aún debe evaluciones y que se le dará nueva oportunidad para rendirlas el vierne 12/07/24 y el viernes 19/07/24. La no presentación a alguna de ellos será calificado con nota mínima 1.0.', '2024-07-09', NULL, '16:03:55', 105, NULL),
