(172, '17716794', 'N', 'INGLÉS : Mientras se está revisando canciones y practica de pronunciación la alumna llama la atención al profesor \"hasta cuando va a seguir con ellas, lleva mucho rato\" se le hace ver lo que se está haciendo de buscar pista de las letras a las letras de las canciones, una de sus compañeras le dice \"debes acercarte tu a la profesora\" y otra le dice \"tienes que tener paciencia\", porque se está buscand o pistas, al no entender se para de manera brusca y se refiere a una de sus compañera Mariana Mora, diciendole \"a ti no te estoy hablando, que te metes\", mientras se acerca a ella, a lo cual la profesora al colocarse en medio le dice que la unica que llama la atención es la profesora y se le pide retirarse a su puesto, lo hace en un principio e intenta volver lanzando amenazas a su compañera Mariana  \"que wea, crees que te tengo miedo, te pego aqui mismo\". Se le pide calma, a lo que Mariana reacciona positivamente pero Gladys vuelve a contestar hasta quedarse callada. La alumna además llego', '2024-07-19', NULL, '12:18:38', 183, 'L'),
