(397, '22393383', 'N', 'INGLÉS : A la alumna se le da nueva oportunidad para rendir evaluaciones y/o completarlas el viernes 12/07/24 y viernes 19/07/24 ella acota \"no dejelas ahí no mas\", por lo que se calificará con nota mínima 1.0 ya que cada oportunidad que se le dio durante el semestre la rechazó.', '2024-07-09', NULL, '15:55:27', 103, 'L'),
(398, '22393383', 'O', 'INSPECTOR GENERAL : Se cita apoderado de Isidora se le explica que hubo una situación que se encuentra involucrada su hija, se llamó a carabineros sin embargo no habrá contatación de lesiones.\r\nSe suspende por 5 días 31/07 a 06/08', '2024-07-30', NULL, '15:58:14', 103, NULL),
(399, '22393383', 'N', 'MATEMÁTICA : Estudiante no anota la materia, ni realiza la actividad de clase, a pesar de indicaciones de la profesora, se dedica a conversar toda la hora.', '2024-08-09', NULL, '16:02:16', 103, 'L'),
(400, '22608397', 'O', 'MATEMÁTICA : Se le da la oportunidad de realizar la prueba n°1 el día virenes 14 de junio. Se compromete a rendir la evaluación y ponerse al día con los contenidos entregados, además entregará el material de trabajo en clases el mimo día. Si incumple es la nota mínima 1.0.', '2024-06-11', NULL, '16:03:53', 118, NULL),
(401, '22608397', 'O', 'DIRECTOR : Apoderada asiste al establecimiento para informarle de los atrasos del alumno y las anotaciones. Se aplica reglamento y el alumno será suspendido por 3 días a partir del día miércoles 05 hasta viernes 7 junio.', '2024-06-04', NULL, '16:07:41', 118, NULL),
(402, '22318710', 'N', 'MATEMÁTICA : Estudiante no realiza actividad de clase, tampoco escribe la materia de la asignatura.', '2024-07-26', NULL, '16:10:25', 96, 'L'),
(403, '22318710', 'N', 'MATEMÁTICA : Estudiante a pesar de indicaciones no realiza actividad de clase, se dedica a jugar en el celular sin anotar la materia de la asignatura, escencial para la realización de evaluaciónes y promoción.', '2024-08-06', NULL, '16:11:36', 96, 'L'),
(404, '22318710', 'O', 'DIRECTOR : Apoderada asiste al establecimiento y toma conocimiento del bajo rendimiento y anotaciones del alumno. Se firma compromiso que el alumno se pondrá al día y conversará con sus profesores.', '2024-06-03', NULL, '16:13:19', 96, NULL),
(405, '22494329', 'N', 'MATEMÁTICA : Estudiante se niega a rendir la evaluación n°2 según reglamento de evaluación obtiene la nota mínima 1.0', '2024-06-04', NULL, '16:18:25', 90, 'L'),
(406, '22494329', 'N', 'MACE : Utiliza teléfono en prueba, obtiene nota mínima 1.0', '2024-06-06', NULL, '16:19:45', 90, 'L'),
(407, '22494329', 'N', 'CIENCIAS NATURALES : Estudiante que utiliza su teléfono celular en clase cuando no se permite.', '2024-07-31', NULL, '16:20:32', 90, 'L'),
(408, '22494329', 'N', 'Estudiante realiza gesto obsceno hacia su compañero Harold, cuando se le menciona que será anotado dice \"Estoy ni ahí\" y \"no me interesa\".', '2024-08-09', NULL, '16:21:32', 90, 'L'),
(409, '22494329', 'N', 'MACE : Estudiante molesta e interrumpe la presentación de INACAP, es sorprendido rayando libros de biblioteca junto a Gino de 4° medio TP eléctrico,', '2024-08-12', NULL, '16:22:57', 90, 'L'),
(410, '21669465', 'O', 'INSPECTOR GENERAL : Se suspende a estudiante por faltas gravisimas de RICE, consumo de sustancias ilicitas, suspención corresponde desde el 7 al 15 fechas inclusive', '2024-06-06', NULL, '16:25:18', 121, NULL),
(411, '22878407', 'O', 'DIRECTOR : Se suspende a estudiante por faltas al RICE (gravisima), portar arma de fuego (juguete) con caracteriasticas reales. Se suspende por 5 días a contar del 12 al 18 ambas fechas inclusive.', '2024-06-11', NULL, '16:26:38', 101, NULL),
(412, '22878407', 'N', 'ESTUDIOS SOCIALES : Estudiante que falta el respeto de manera constante al profesor, sale de la sal de clases e incluso da golpes muy fuertes en la sala y antes de terminar la clase sólo se dedicaa molestar al docente, sin que este último otorgue ningun grado de confianza.', '2024-07-31', NULL, '16:29:04', 101, 'L'),
(413, '22878407', 'N', 'CIENCIAS NATURALES : Estudiante ocupa su teléfono celular en clases cuando no está permitido', '2024-07-31', NULL, '16:31:57', 101, 'L'),
(414, '22878407', 'N', 'MATEMÁTICA : Estudiante a pesar de indicaciones no realiza la actividad de clase y se dedica a jugar en el celular, además es sorprendido copiando la actividad de clase.', '2024-08-06', NULL, '16:33:05', 101, 'L'),
(415, '22488270', 'O', 'INGLÉS : Se le informa al alumno que tiene sus evaluaciones pendientes y que tendrá que rendirlas el dpia viernes 19, si él no asiste se le calificará con nota mínima 1.0', '2024-07-12', NULL, '16:34:37', 95, NULL),
(416, '22488270', 'N', 'MATEMÁTICA : Estudiante no realiza actividad de clase, se dedica a jugar con el celular.', '2024-05-30', NULL, '16:36:21', 95, 'L'),
(417, '22488270', 'N', 'ESTUDIOS SOCIALES: Estudiante que no logra quedarse en silencio en el desarrollo de la clase y sólo se dedica a jugar en el celular, se le solicita que lo guarde pero no hace caso. Se le pide que se cambie de asiento y dice \" aunque me cambie no haré nada\", el docente continua explicando la clase y el estudiante continua jugando con el celular y al indicarle que deje de utilizar el celular mueve los hombros en señal de indiferencia, ante esto se le solicta que abandone la sala, ya había sido sacado de la sala en la hora anterior en Ciencias Naturales.', '2024-08-01', NULL, '16:38:12', 95, 'L'),
(418, '22488270', 'N', 'ESTUDIOS SOCIALES: Estudiante que no logra quedarse en silencio en el desarrollo de la clase y sólo se dedica a jugar en el celular, se le solicita que lo guarde pero no hace caso. Se le pide que se cambie de asiento y dice \" aunque me cambie no haré nada\", el docente continua explicando la clase y el estudiante continua jugando con el celular y al indicarle que deje de utilizar el celular mueve l', '2024-08-01', NULL, '16:38:12', 95, 'L'),
(419, '22488270', 'N', 'LENGUAJE : Estudiante que durante todo el periodo de clases no trabaja y tampoco registra contenido. Se niega a preparar diálogo evaluado, cuando la profesora le menciona que será informado a inspectoría, él responde diciendo ...\"Y llámelo no más\".\r\nSe deja en onservación  que de no presentar trabajo, será evaluado con nota mínima.', '2024-08-05', NULL, '16:42:24', 95, 'L'),
(420, '22488270', 'N', 'MACE : Estudiante se rehusa a finalizar trabajo evaluado, se dedica a jugar en su teléfono Free Fire. Se le sigue pidiendo que tewrmine su trabajo pero dice que no lo hará, se pondera con nota 1.0.', '2024-08-05', NULL, '16:45:32', 95, 'L'),
(421, '22488270', 'N', 'LENGUAJE : Estudiante que utiliza celular en clases, además de no resgistrar contenido.\r\nHace caso omiso frente a cualquier indicación del profesor. Se le pide retirarse de la sala', '2024-08-12', NULL, '16:47:46', 95, 'L'),
(422, '22928857', 'O', 'INGLÉS : Al alumno se le da nueva oportunidad para rendir evaluaciones pendientes para viernes 12/07/24 y viernes 19/0724 la no presentación a ellas será calificada con nota mínima 1.0', '2024-07-09', NULL, '16:50:00', 104, NULL),
(423, '22928857', 'O', 'INSPECTOR GENERAL : Se cita apoderado de Maximiliano, se le explica que hubo una situación de riña encuentra involucrado su hijo. Se llamó a carabineros sin embargo no hubo constatación de lesiones.\r\nSe suspende por 5 días 31/7 - 06/08', '2024-07-30', NULL, '16:52:04', 104, NULL),
(424, '22297206', 'O', 'INSPECTOR GENERAL : Se suspende al alumno por atrasos reiterados, a contar del día lunes 22 de julio hasta el viernres 26 de julio, ambas fechas inclusive.\r\nSe cita apoderado para tomaconocimiento', '2024-07-19', NULL, '16:54:49', 93, NULL),
(425, '22297206', 'N', 'MATEMÁTICA : Estudiante no realiza actividad de clase, se dedica a jugar con el celular.', '2024-07-19', NULL, '16:56:29', 93, 'L');
INSERT INTO `anotaciones` (`idanotaciones`, `alum_run`, `tipo`, `anotacion`, `fanota`, `profesor`, `hanota`, `alum_idalum`, `categoria`) VALUES
(426, '22297206', 'O', 'INSPECTOR GENERAL : Se cita apoderada por situación de riña ocurrida en el establecimiento. Por lo anterior se llama a Carabineros los cuales indican que no hubo lesiones.\r\nSe suspende alumno por 5 días 31/07 - 06/08 ambas fechas inclusive.', '2024-07-30', NULL, '16:57:42', 93, NULL),
(427, '22881581', 'N', 'LENGUAJE : La estudiante debió haber presentado trabajo práctico (representación) el día 30 de julio, sin embargo para el día 6 de agosto se le da la oportunidad de hacerlo, considerando su falta de responsabilidad será evaluada con nota mínima.', '2024-08-06', NULL, '09:00:28', 166, 'L'),
(428, '22881566', 'N', 'MATEMÁTICA : Estudiante no escribe la materia de la asignatura y además no realiza actividad de clase. Destina su tiempo a jugar con el celular.', '2024-07-29', NULL, '09:04:09', 167, 'L'),
(429, '22881566', 'N', 'LENGUAJE : La estudiante debió haber presentado trabajo práctico (representación) el día 30 de julio, sin embargo para el día 6 de agosto se le da la oportunidad de hacerlo, no presentando nada para ser evaluada, considerando su falta de responsabilidad es evaluada con nota mínima.', '2024-08-06', NULL, '09:06:10', 167, 'L'),
(430, '22881566', 'N', 'ESTUDIOS SOCIALES : La estudiante se plancha el pelo mientras el docente explica referente al movimiento de pobladores, especialista se acerca a ella y le pide que por favor se deje de planchar el pelo y lo desenchufe. Lamentablemente no obedece, se le vuelve a decir que deje la acción o sino la voy anotar, cosa que no hace caso.', '2024-08-08', NULL, '09:08:32', 167, 'L'),
(431, '20651429', 'N', 'LENGUAJE : Estudiante que se niega a rendir diálogo evaluado. Pide permiso para salir de la sala y no regresa, luego de 15m. Se le pide comportarse para rendir evaluación para el día martes 06 de agosto, pidiendole firmar compromiso, a lo que el estudiante se niega diciendo que no es  necesario porque sepresentará para tal fecha. Se deja observación ya que no asistió, será evaluado con la nota mín', '2024-08-02', NULL, '10:07:53', 202, 'L'),
(432, '20651429', 'P', 'T.I.C. Estudiante que apoya y ayuda a sus compañeros en el uso de plataformas digitales y el uso del computador.', '2024-08-08', NULL, '10:19:43', 202, NULL),
(433, '20651429', 'N', 'LENGUAJE : Estudiante que  o rinde diálogo evaluado, aún cuando se le otorgan tres oportunidades para darlo, él se niega a hacerlo frespondiendo de manera alterada a la profesora. Se deja observación que será evaluado con nota mínima a pedido del alumno.', '2024-08-09', NULL, '10:21:46', 202, 'L'),
(434, '100627887', 'N', 'CIENCIAS NATURALES : Estudiante que no realiza nada durante la hora de clase, se dedica 100% a estar en su teléfono sin realizar ningún ejercicio de la guía de aprendizaje de movimiento.', '2024-04-29', NULL, '10:33:06', 94, 'L'),
(435, '100627887', 'N', 'LENGUAJE : Estudiante se niega a avanzar, siquiera empezar la creación de cuento. Cuando se le pregunta si va a escribirlo responde diciendo \"nah\" y procede a estar en su celular.', '2024-06-11', NULL, '10:37:21', 94, 'L'),
(436, '22775021', 'O', 'PROFESOR JEFE : Alumno que se juega con Jasmine a las llaves, ella se molesta y le pega una cachetada, Jvier se enoja, contiene su rabia y sale de la sala hacia el baño, yo voy tras él, él entra y golpea parede del baño, combos a la pared y patadas al basurero, trato de contenerlo, llega Inspector General y se hace cargo del caso.', '2024-08-12', NULL, '12:56:23', 6, NULL),
(437, '22258258', 'N', 'MATEMÁTICA : Estudiante es sorprendido copiando la guía de gtrabajo en clases, a pesar de esto niega su actuar.', '2024-07-22', NULL, '13:15:49', 129, 'L'),
(438, '21890868', 'N', 'LENGUAJE : Estudiante que no trabaja durante todo el periodo de clases, diciendo que \"no se presentará el día de la evaluación\". Además de una manera irrespetuosa contesta su teléfono en pleno desarrollo de la clase, sin pedir permiso. \r\nSe le pide quwe se retire de la sala por las reiteradas faltas de respeto.', '2024-08-13', NULL, '13:17:45', 142, 'L'),
(439, '22464825', 'N', 'Al alumno se le llama la atención por no  realizar actividades en clases, conversa se rie interfiere con el desarrollo de la clase, hace uso de celular ve videos que muestra a sus compañeros, se rie al llamarle la atención nuevamente, se molesta y contesta de mala forma, al no terminar con el incentivo al desorden se le pide salir de la sala, a lo que al pasar por el lado de la profesora dice \"man', '2024-08-13', NULL, '13:25:50', 125, 'L'),
(440, '21969826', 'N', 'INSTALACIÓN ELECTRICA : Estudiante entrega evaluaciones en blanco a pesar que las formulas están en la evaluación.', '2024-05-16', NULL, '13:32:44', 137, 'L'),
(441, '22808110', 'N', 'DOMSCE : A pesar que tubo 4 clases para practicar no lo hace por estar con el celular y cuando tiene que rendir la evaluación no lo hace por tanto es calificado con nota mínima.', '2024-08-09', NULL, '13:35:59', 138, 'L'),
(442, '22808110', 'N', 'DOMSCE : Estudiante está toda la clase con su celular en la mano jugando o revisando las redes sociales y no realiza la práctica de Inv. de giro.', '2024-08-09', NULL, '13:38:26', 138, 'L'),
(443, '22245001', 'N', 'INGLÉS : El alumno no realiza actividades en clases, hace uso de celular, conversa, se rie y además sirve jugo a sus compañeros incentivando al desorden e interrumpiendo el desarrollo de la clase, se le pide salir de la sala.', '2024-08-13', NULL, '13:46:18', 128, 'L'),
(444, '22842299', 'N', 'LENGUAJE : Estudiante que durante todo el periodo de la clase, no registra contenido, no realiza actividad evaluada. Se dedica a conversar fuertemente junto sus compañeros.', '2024-08-13', NULL, '14:09:16', 110, 'L'),
(445, '22750648', 'N', 'LENGUAJE : Estudiante que durante todo el periodo de la clase, no registra contenido, tampoco realiza actividad evaluada.\r\nGeneralmente el estudiante no saca cuadernos, mantiene nlos pies sobre la silla, demostrando una actitud de desinterés e irreponsabilidad con sus compromisos estudiantiles.', '2024-08-13', NULL, '14:13:47', 115, 'L'),
(446, '22318710', 'N', 'INGLÉS : Estudiante no realiza ninguna actividad dada ni los contenidos de la pizarra, solo se dedica a jugar con su celular.', '2024-08-13', NULL, '14:21:20', 96, 'L'),
(447, '22494329', 'N', 'MATEMÁTICA : Estudiante interrumpe la actividad realizada por admisión INACAP, mantiene actitud disruptiva a pesarr de indicación de profesores.', '2024-08-12', NULL, '14:25:46', 90, 'L'),
(448, '22494329', 'N', 'INGLÉS : Al alumno se le llama reiteradas veces la atención por hablar fuerte por contestar a los compañeros y por estar jugando con el celular juegos en los cuales grita y lanza palabras que no con corresponde diciendo \"conchetumadre, culiao ....\" además lanza pelotas de papel a otro compañero y continua vociferando groserias, se le vuelve a llamar la atención y no entiende se le pide salir de la sala, no suficiente con eso continua ingresando a molestar a la sala \"que no anote que pone tan largo...\" cuando se le pide que regrese afuera dice \"filo, filo ...\" al salir apaga las luces de la sala, dos veces y una tercera al pasar por fuera, además en una cuarto intento de entrar a la salalo hace diciendo \"la voy a grabar\"...y continua haciendo ingresos a la sala o hasta la puerta haciendo interrupciones \"profe ya arregle sus cosas y vayase\" no más\" al final reclama y dice \"anotame no mas conchetumadre\" \"ya profe deje de darle color si nadie la pescará \", cuando se le llama la atención po', '2024-08-13', NULL, '14:28:51', 90, 'G'),
(449, '22205601', 'N', 'INSPECTOR GENERAL : Alumna se encuentra en oficina de inspectoría esperando a una funcionaria, cuando tocan campana alumna todavía sigue en la sala de inspectoría, se le invita a ir a la sala de clases mientrasrayaba la mesa de la funcionaria, cuando se le dice que no raye la mesa indica de mala manera \"acaso la mesa es tuya\" parandose y retirandose hacia la sala. En el transcurso y ya en el patio increpa groseramente diciendome \"que te pasa viejo culiao\", al llegar a la sala no quiere dar su nombre y apellido.\r\nSe aplica reglamento del colegio, se suspende por 5 días desde hoy 13/08 hasta 21/08 ambas fechas inclusive.\r\nPodtrá regresar en día 22/08.', '2024-08-14', NULL, '09:52:33', 161, 'G'),
(450, '22332564', 'O', 'LENGUAJE : El estudiante se compromete a rendir la evaluación formativa de mundos literarios la próxima semana.', '2024-05-28', NULL, '12:47:10', 108, NULL),
(451, '22332564', 'O', 'MATEMÁTICA : Estudiante se compromete a estudiar , ponerse al día para rendir la evaluación el día 07 de junio. Si incumple obtendrá la nota mínima 1.0', '2024-05-28', NULL, '12:48:12', 108, NULL),
(452, '22332564', 'N', 'LENGUAJE : Alumno se niega a realizar la evaluación acordada afirmando que le da igual, según el reglamento de evaluación obtiene la nota mínima.', '2024-06-04', NULL, '12:50:27', 108, 'L'),
(453, '22332564', 'O', 'INGLÉS : Al alumno se le informa que tiene aún evaluaciones pendientes y se le dará la oportunidad de rendirlas, prueba y guías, viernes 12/07/24 y viernes 19/07/24, la no presentación a rendir alguna evaluación será calificado con nota mínima 1.0 ya que oportunidades esta sería la última.', '2024-06-09', NULL, '12:52:28', 108, NULL),
(454, '22332564', 'N', 'MATEMÁTICA : Estudiante no realiza actividad de clase, se dedica a jugar con el celular', '2024-08-06', NULL, '12:56:38', 108, 'L'),
(455, '22332564', 'N', 'INGLÉS : Al alumno se le llama la atención por uso de celular, no copia los contenidos, no realiza las actividades, se dedica a jugar videos, situación que es reiterada en todas las clases.', '2024-08-13', NULL, '12:59:28', 108, 'L'),
(456, '26152910', 'N', 'INGLÉS : El alumno no realiza las actividades, solo se dedica a jugar con su celular es sistemático en todas las clases.', '2024-08-13', NULL, '14:27:21', 87, 'L'),
(457, '22865232', 'N', 'INGLÉS : El alumno se dedica a jugar con celular. Está mas pendiente de él que de hacer correctamente las actividades, deberá mantener su celular guardado.', '2024-08-13', NULL, '14:50:36', 98, 'L'),
(458, '22630535', 'N', 'INGLÉS : El alumno no realiza actividades de la clase no escribelos contenidos, sólo se dedica a jugar con su celuelar, esta situación es reiterativa.', '2024-08-13', NULL, '15:06:34', 119, 'L'),
(459, '22630535', 'N', 'CIENCIAS NATURALES : Estudiante que ocupa teléfono celular cuando no es permitido.', '2024-08-01', NULL, '15:08:50', 119, 'L'),
(460, '22308879', 'N', 'MATEMÁTICA : Estudiante sin realizar la actividad de clase, que corresponde al repaso de la unidad n°3 para la evaluación. Dedica su tiempo a jugar con el celular.', '2024-05-24', NULL, '15:13:23', 100, 'L'),
(461, '22308879', 'N', 'MATEMÁTICA : Estudiante a pesar de indicaciones se dedica a jugar en el celular, sin realizar la actividad de clase.', '2024-08-06', NULL, '15:15:39', 100, 'L'),
(462, '22445778', 'N', 'CIENCIAS NATURALES : Estudiante entrega evaluación correspondiente a \"Nutrición\" en blanco, argumenta no saber nada ya que estaba suspendido, es calificado con nota mínima de acuerdo a reglamento. Acto seguido, toma la evaluación la hace una bola y la lanza al basurero.', '2024-08-14', NULL, '15:54:08', 122, 'L'),
(463, '16827729', 'O', 'LENGUAJO : Alumno se compromete a rendir prueba día martes 04/06 con nota máxima 6.5. Carta al Dr', '2024-05-31', NULL, '11:48:42', 10, NULL),
(464, '22393383', 'O', 'LENGUAJE : La estudiante se comprometió para rendir a la fecha evaluación (diálogo) realizado el día 05 de Agosto, sin embargo ella solicta ser evaluada con nota mínima diciendo que no la dará.', '2024-08-19', NULL, '13:05:18', 103, NULL),
(465, '22909916', 'N', 'LENGUAJE : La estudiante se niega a realizar la evaluación con la excusa de no haber asistido a las clases pasadas y por ende no saber \"nada\".', '2024-05-28', NULL, '13:17:21', 7, 'L'),
(466, '22909916', 'O', 'MATEMATICAS : Se le da la oportunidad a la estudiante de rendir la evaluación el día 6 de junio. La estudiante se compromete a estudiar y ponerse al día. Se le entregan guías para completar y traer el mismo día. Si no cumple obtendrá nota 1.0.', '2024-05-28', NULL, '13:19:58', 7, NULL),
(467, '22928857', 'N', 'LENGUAJE : El estudiante se comprometió para rendir evaluación a la fecha, a pesar que ests debió ser realizada el día 05 de agosto, sin embargo solicita expresamente ser evaluado con nota mínima, diciendo que no lo rendirá.', '2024-08-19', NULL, '13:28:05', 104, 'L'),
(468, '22820327', 'O', 'PROFESORA JEFE : Alumna se niega a dar prueba de Ciencias Naturales que se le había dado plazo.', '2024-08-19', NULL, '13:34:44', 4, NULL),
(469, '22837861', 'O', 'LENGUAJE : A la estudiante se le entregó el libro el día lunes 29 de agosto para que pudiera leerlo, el miércoles 31 me lo entregó diciendo que escucharía  el audio libro y luego viene me entrega la prueba en blanco en donde me dice que no le pasaron el audio libro. Cabe mencionar que se le había avisado en las vacaciones de invierno el libro que debía leer.', '2024-08-02', NULL, '13:35:48', 11, NULL),
(470, '22820327', 'N', 'OFICIO: Estudiante no realiza actividad, no trabaja', '2024-08-20', NULL, '14:56:15', 4, 'L'),
