(547, '22488270', 'O', 'INSPECTOR GENERAL : Padres de Jonathan vienen para informarse sobre situación y comportamiento de su pupilo, se compromete a tener buena actitud y comportamiento y obedecer a sus profesores.', '2024-08-28', NULL, '14:15:23', 95, NULL),
(548, '19127781', 'O', 'MACE : Estudiante no rinde evaluación y se le pone nota mínima.', '2024-08-29', NULL, '14:17:47', 58, NULL),
(549, '22488270', 'N', 'INGLÉS : Al estudiante se le llama la atención por uso de parlante a volumen fuerte, se le llama la atención varias veces y él contesta \"no lo voy a bajar\", todo esto a causa de que se le había llamado la atención por el uso de celular a volumen fuerte e interrumpiendo el trabajo de compañero a lo que el estudiante agrega \"yo le voy a subir el volumen todo lo que quiera, si la caga de celular es mia\", se le hace ver que la actividad que se está desarrollando es con nota , a lo que contesta \"no voy hacer ninguna wea de lo que usted me diga\", luego se retita de la sala 15 minutos antes de que termine la clase sin autorización.', '2024-08-30', NULL, '14:19:14', 95, 'G'),
(550, '22928857', 'O', 'MATEMÁTICA : Estudiante no realiza actividad de clases.', '2024-08-27', NULL, '14:27:49', 104, NULL),
(551, '22445778', 'N', 'MATEMÁTICA : Después que Felipe Silva terminara su evaluación sin provocación aparente, el estudiante sacó unas tijeras del estuche se du profesora. El estudiante de forma sigilosa se aproxima a su profesora por la espalda mientras esta se encontraba monitoreando la evaluación de sus compañeros, Con las tijeras en la mano adoptó una postura de ataque  levantando el instrumento hacia la altura de su cabeza. La profesora ala girarse y percatarse de la amenaza reacciona con tranquilidad, Felipe Silva devuelve la tijera en el estuche y es enviado a donde el Inspector general, mencionando que su conducta es una falta gravisima.\r\nEste acto constituye una falta gravisima con potencial de causar daño físico, a pesar de evitar una posible tragedia, el impacto emocional y psicologico es considerable.', '2024-09-03', NULL, '14:31:00', 122, 'GMA'),
(552, '22445778', 'O', 'INSPECTOR GENERAL : La señora Verónica Cáceres junto a su esposo Eduardo Pérez fueron citados por inspectoría para mencionar los hechos conductuales de Felipe Silva. Se le informa la situación, se le explica la suspención por irrespetuoso con la profesora y amenaza con tijera con otra profesora.\r\nSe le explica que la segunda situación es muy grave según el relato de la profesora y que se estudiará la aplicación de procedimiento de aula segura. \r\nSe suspende por 5 días a contar de mañana 4/09 al 10/09 ambas fechas inclusive.', '2024-09-03', NULL, '14:45:16', 122, NULL),
(553, '22494329', 'N', 'MATEMÁTICA : Estudiante durante la realización de la prueba, mantiene una actitud disruptiva, conversando constantemente con sus compañeros. A pesar de indicaciones, camina por la sala, se cambia de puesto, ralla una mesa pintando un dibujo. Es enviado con el Inspector General.', '2024-09-03', NULL, '15:17:44', 90, 'L'),
(554, '22411477', 'O', 'INSPECTOR GENERAL : Apoderada viene a justificar inasistencia de su hijo por los días de ayer 4 y 5 de septiembre. además solicita reunión con profesor de electricidad (Profesor Gmo) y profe de matemática.', '2024-09-05', NULL, '10:05:45', 136, NULL),
(555, '22590523', 'O', 'CIENCIAS NATURALES : Estudiante que no realiza actividad de clase.', '2024-09-05', NULL, '11:01:52', 160, NULL),
(556, '22557461', 'N', 'CIENCIAS NATURALES : Estudiante que no realiza actividad de clase', '2024-09-05', NULL, '11:03:47', 154, 'L'),
(557, '22652962', 'N', 'INSPECTOR GENERAL : Alumna fue sorprendida con cigarro (apagado) en el baño de mujeres por la encargada de convivencia, se conversa con ella explicando la falta al RICE, amonestación verbal.', '2024-09-04', NULL, '11:05:47', 163, 'L'),
(558, '22444855', 'O', 'INPECTOR GENERAL : Alumna fue sorprendida con cigarro (apagado) en el baño de mujeres por la encargada de convivencia, se conversa con ella explicando la falta ante el  RICE. Amonestación verbal', '2024-09-04', NULL, '11:24:02', 168, NULL),
(559, '100720716', 'N', 'OFICIO : Estudiante mancha con plumón a su compañera Alexia en su cara.', '2024-09-05', NULL, '12:03:33', 7, 'L'),
(560, '100720716', 'N', 'OFICIO : Estudiante mancha con plumón a su compañera Alexia en su cara.', '2024-09-05', NULL, '12:03:33', 7, 'L'),
(561, '22781695', 'O', 'INSPECTOR GENERAL : Mamá de Daniel, Verónica Gutierrez se presenta para justificar inasistencia de su hijo el día miércoles 21/08. El alumno se presentará a clases la próxima semana. No vino a clases por lluvia y resfrío.', '2024-08-23', NULL, '12:10:07', 10, NULL),
(562, '22837861', 'N', 'INSPECTOR GENERAL : Alumna tras protagonizar un incidente con  mobiliario  del colegio tratando e ingresar a la fuerza a la sala de clases cuando la puerta de acceso estaba cerrada, se le manifiesta que no puede comportarse de tal manera, a lo que de una manera soez y prepotente sale de la sala de clases y se fuga del establecimiento, activando protocolo llamando a carabineros y avisando a residencia.\r\nSe entrevista a residencia, se explica la situación según RICE, se suspende por 5 días hábiles desde hoy 02/09 hasta 06/09 ambas fechas inclusive.', '2024-08-30', NULL, '12:18:21', 11, 'G'),
(563, '23169088', 'O', 'INSPECTOR GENERAL : Apoderado se entrevista con asitente socialEncargada de convivencia e inspector para contextualizar el hecho de su inasistencia.\r\nJustifica inasistencia', '2024-09-03', NULL, '12:28:53', 2, NULL),
(564, '22820327', 'N', 'OFICIO : Estudiante raya con plumón a compañero, el compañero  reacciona y también la pinta con plumón, Alexia se molesta y se enoja y comienza a rayar a su compañero de manera agresiva, se le llama la atención para que deje de actuar de esa manera , pero persiste, separo la situación y Alexia toma su mochila y sale de la sala de clases sin autorización.', '2024-09-05', NULL, '12:53:36', 4, 'L'),
(565, '26152910', 'N', 'CIENCIAS NATURALES : Estudiante que se dedica a estar en su celularocupando audifonos , no respondiendo a la lista y no realizando actividades de clase.', '2024-09-04', NULL, '13:00:50', 87, 'L'),
(566, '22563597', 'N', 'CIENCIAS NATURALES : Estudiante que no realiza ninguna actividad de la clase, dedicandose a jugar en su teléfono durante toda la hora.', '2024-09-04', NULL, '13:03:45', 105, 'L'),
(567, '22630535', 'N', 'MACE : Estudiante no rinde evaluación , ocupa teléfono toda la clase, se califica con nota mínima 1.0', '2024-08-29', NULL, '13:10:16', 119, 'L'),
(568, '22547207', 'N', 'CIENCIAS NATURALES : Estudiante que no realiza ninguna actividad de la clase, se dedica a estar en su celular.', '2024-09-04', NULL, '13:12:05', 89, 'L'),
(569, '22842299', 'N', 'CIENCIAS NATURALES : Estudiante que no realiza ninguna actividad de la clase y se dedica a dormir toda la hora', '2024-09-04', NULL, '13:33:55', 110, 'L'),
(570, '22570056', 'N', 'CIENCIAS NATURALES : Estudiante que no hace ninguna actividad de la clase y se dedica a jugar con su teléfono celular', '2024-09-04', NULL, '13:38:16', 116, 'L'),
(571, '22750648', 'N', 'INGLÉS : El alumno con su compañero Benjamín Soto, al ingreso a clases de un receso(recreo)y mientras la profesora viene hacia la sala comenta \"que viene con la pierna coja\", no suficiente con eso al cruzar la puerta la profesora esquiva un intento de zancadilla, al no lograr el objetivo de hacerla tropezar vuelve a intentar lo de la zancadilla, produciendo dolor fuerte en la rodilla, ya que con esto provoca torcedura y/o salida de rotula en la rodilla, el alumno se rie burlandose, cuando se le llama la atención haciendo sentire a la profesora vulnerable, pasada a llevar, humillada ante tal falta de respeto y por la falta gravisima cometida, el alumno es llevado a Inspectoría e informando situación a encargada de convivencia escolar para toma de medidas correspondientes.', '2024-09-06', NULL, '13:40:10', 115, 'GMA'),
(572, '22205601', 'N', 'CIENCIAS NATURALES : Estudiante que estando en el colegio no entra a la sala de clases (situación que no es la primera vez que ocurre) siendo vista por inspectores de patio. La estudiante queda ausente y se procede a dejar registro.', '2024-09-04', NULL, '15:18:49', 161, 'L'),
(573, '22318710', 'N', 'CIENCIAS NATURALES : Estudiante que no realiza ninguna actividad de clase dedicandose a jugar con su teléfono celular.', '2024-09-04', NULL, '15:41:46', 96, 'L'),
(574, '22494329', 'N', 'INGLÉS : El alumno con su compañero Germán Cardenas al ingreso a clases luego de un receso(recreo) y mientras la profesora viene hacia la sala comenta \"que tiene la pata coja\" no suficiente con eso al cruzar la puerta la profesora esquiva un intento de zancadilla, al no lograr el objetivo vuelve a intentar la zancadilla produciendo fuerte dolor en la rodilla, al llamar la atención ya que con esto provoca torcedura en la rodilla y/o salida de rotula, el alumno se rie burlandose haciendo sentir vulnerable, pasada a llevar, humillada a la profesora, ante tal falta de respeto y por falta gravisima cometida, el alumno es llevado a Inspectoría e informando la situación a ecargado de convivencia para toma de medidas correspondientes.', '2024-09-06', NULL, '15:46:11', 90, 'GMA'),
(575, '22494329', 'O', 'INSPECTOR GENERAL : Apoderada Sra Erika es citada para informar la situación de conductas groseras, faltas de respeto hacia profesores y funcionarios dentro de la sala de clases de su pupilo. Se aplica RICE falta grave se suspende por 5 días a contar del día 9 al 15 de septiembre.', '2024-09-06', NULL, '16:14:19', 90, NULL),
(576, '15826751', 'N', 'CIENCIAS NATURALES : Estudiante pide permiso para ir al baño y no regresa a clases hasta depues del toque de timbre (30 minutos apox)', '2024-09-09', NULL, '14:12:19', 31, 'L'),
(577, '20651429', 'N', 'ESTUDIOS SOCIALES : Estudiante que le menciona al profesor que no existe información sobre la historia Parroquia san josé de Parral, a lo que el docente saca su celular y él busca información y le menciona al estudiante que si hay información. El estudiante menciona que irá al PIE a imprimir unas imagenes y se molesta mencionando que debe hacer \"toda la wea denuevo\", sale de la sala rumbo al PIE, en dicha oficina se le brinda lo solicitado y se le menciona en la sala que haga el trabajo, pero la actitud del estudiante es violenta y al escuchar que su compañera Mónica le indica que haga el trabajo, el estudiante dice \"Estoy chato que todos me weben aquí y al salir de la sala da un gran golpe portazo y abandona la sala sin autorización del docente, acción que segun nuestro reglamento menciona : \"Falta grave\": \"textual\": 11, hacer abandono del aula sin autorización  (pag. 34).\r\nEl docente sale a buscar al estudiante y está sentado muy enojado y no atiende a las indicaciones del docente. P', '2024-09-10', NULL, '14:15:02', 202, 'G'),
(578, '22733775', 'N', 'POFESOR JEFE: Estudiante que a pesar de hablarle mucho en sala sigue riendose y conversando en la sala con Javier Canales, es enviado fuera de la sala.', '2024-09-11', NULL, '16:33:17', 8, 'L'),
(579, '22820327', 'N', 'PROFESOR JEFE: Alumno que se rie a carcajadas en charla del abogado, profesor David Guajardo le pide le pide qeu abandone el auditorio. Se envía a la sala de clases.', '2024-09-25', NULL, '16:35:12', 4, 'L'),
(580, '22820327', 'O', 'INSPECTOR GENERAL: Debido a la acumulación de faltas graves mas leves se suspende a la alumna a contar de mañana 26.09 por 5 días hasta 01.10 ambas fechas inclusive. Podrá regresar el día 02.10.\r\n14.30 vendrá apoderada de Alexia', '2024-09-25', NULL, '16:38:04', 4, NULL),
(581, '22775021', 'N', 'JEFATURA: Alumno que raya la mesa (dibuja cuadros) con lápiza rojo, se le pide que borre lo hecho, dice con que ?', '2024-09-23', NULL, '16:40:43', 6, 'L'),
(582, '22775021', 'N', 'JEFATURA: Alumno que no entra a la sala después del toque de timbre. Se le habla que entre y no obedece, sigue con su celular en el patio.', '2024-09-23', NULL, '16:43:36', 6, 'L'),
(583, '22775021', 'N', 'PROFESOR JEFE: Alumno que solicita permiso para ir al baño, se le da permiso y se queda afuera, no entra a clases.', '2024-09-24', NULL, '16:44:55', 6, 'L'),
(584, '22837861', 'N', 'PROFESOR JEFE: Estudiante se rie a carcajadas en charla del abogado, profesor David Guajardo le pide que abandone el auditorio. Se envía a la sala de clases.', '2024-09-25', NULL, '16:45:53', 11, 'L'),
(585, '22837861', 'O', 'INSPECTOR GENERAL : Se conversa con alumna sobre situación acontecida en salón, si continua con su conducta será suspendida.', '2024-09-25', NULL, '16:47:15', 11, NULL),
(586, '22775021', 'N', 'MATEMÁTICAS: Alumno que se le llama la atención varias veces y sigue golpeando la mesa y riendose en la sala junto a David, es enviado fuera de la sala', '2024-09-11', NULL, '16:51:44', 6, 'L'),
(587, '22411477', 'O', 'INSPECTOR GENERAL: Apoderada viene a justificar inasistencia de su hijo por los días de ayer 4.09 y 5.09 de septiembre, además solicita reunión con profesor de electricidad (prof. Gmo) y profe de matemáticas.', '2024-09-05', NULL, '16:53:53', 136, NULL),
(588, '22808110', 'N', 'DOMSCE: Estudiante que norealiza ningunaactividad práctica en el taller eléctrico a pesar que se le insiste en cada clase práctica que trabaje, porque sino práctica en la evaluación práctica tiene una gran posibilidad de que pueda realizar la evaluación a pesar de todo lo conversado no trabaja y prefiere estar con su celular.', '2024-09-06', NULL, '16:57:23', 138, 'L'),
(589, '21879330', 'O', 'INSPECTOR GENERAL: Aurelio Saldaña, padre de Sergio viene a consultar situación académica y conductual, alumno vive ahora en casa de tia María Carrasco. Villa don Guillermo pasaje # 2 #598.  Se le informa sobre asistencia y nota.', '2024-09-09', NULL, '17:01:10', 84, NULL),
(590, '16241682', 'O', 'PROFESOR  JEFE : Se conversa con la estudiante por pruebas atrasadas, se da tiempo hasta la próxima semana para tomar notas pendientes.', '2024-10-02', NULL, '15:06:43', 14, NULL),
(591, '22733775', 'O', 'PROFESOR JEFE: Se conv ersa con el estudiante sobre las notas pendientes, se da plazo hasta la próxima semana para rendir notas pendientes.', '2024-10-02', NULL, '15:10:38', 8, NULL),
(592, '22781695', 'O', 'PROFESOR JEFE: Se conversa con el alumno sobre todas la notas pendientes, se da plazo hasta la póxima semana para rendirlas.', '2024-10-02', NULL, '15:11:49', 10, NULL),
(593, '22781695', 'N', 'PROFESOR MATEMÁTICAS : Se le pide que se cambie de lugar ya que sólo conversa y el responde con tono amenazante y grosero : va no me voya a cambiar, se le vuelve a pedir que por favor se cambie, sigue con la negativa, se le dice que se enviará a inspectoría cuando se termine la clase grabada del colega y él dice : Envieme altiro. Alumno desafiante,', '2024-10-02', NULL, '15:12:49', 10, 'L'),
(594, '21377619', 'O', 'PROFESOR JEFE: Alumna que no asiste hace mucho a clases, se le llama por teléfono y no contesta, se llamaa la mamá y ella dice que Natalia no quiere asistir y además está trabajando cuidando a un niño.', '2024-10-01', NULL, '15:16:16', 15, NULL),
(595, '23169088', 'O', 'PROFESOR JEFE: El día de hoy vuelve a clases después de varios días Benjamín, se le dice que se le debe tomar pruebas pendientes por sus inasistencias, se conversa con él y se llega al acuerdo que dará algunas materias mañana martes 01/10.', '2024-09-30', NULL, '15:18:25', 2, NULL),
(596, '23169088', 'O', 'PROFESOR JEFE: Alumno que n o asiste a clases a dar pruebas pendientes, se llama por telefono a la madre para comentarle el tema y ella responde \"tía Benjamín no quiere ir a c lases, yo no puedo hacer nada\".', '2024-10-01', NULL, '16:02:11', 2, NULL),
(597, '22820327', 'O', 'PROFESOR JEFE: Se conversa con la estudiante sobre materias pendientes, se da plazo hasta la próxima semana para rendir notas pendientes.', '2024-10-02', NULL, '16:03:55', 4, NULL);
INSERT INTO `anotaciones` (`idanotaciones`, `alum_run`, `tipo`, `anotacion`, `fanota`, `profesor`, `hanota`, `alum_idalum`, `categoria`) VALUES
(598, '22775021', 'N', 'LENGUAJE: Alumno que lanza bolsa de té usada a compañero Javier Chacón a pesar de haberle dicho que no lo hiciera, porque estaba jugando con ella a moverla.', '2024-09-27', NULL, '16:04:54', 6, 'L'),
(599, '22837861', 'O', 'PROFESOR JEFE: Se conversa con la alumna sobre notas pendientes, se da plazo hasta la próxima semana para rendir notas.', '2024-10-02', NULL, '16:06:10', 11, NULL),
(600, '22837861', 'N', 'PROFESOR JEFE: Alumna se para de su puesto y da una pastilla a David, le dice tomatela para que estés relajado, se le pide a David que entregue la pastiilla, él la entrega, se habla con la estudiante y ella dice que es un S.O.S que tiene el sobre (envase pelado) lo entrega. Se avisa a dirección Inspectoría y Convivencia.', '2024-10-02', NULL, '16:07:23', 11, 'G'),
(601, '22563597', 'N', 'INGLÉS : El alumno no escribe la materia, las actividades dadas, sólo se dedica a jugar con su celular, esta situación es reiterativa , además no tgrae cuaderno.', '2024-09-27', NULL, '16:11:41', 105, 'L'),
(602, '22630535', 'N', 'CS NATURALES : Estudiante que no parfticipa en lectura de guía de trabajo.', '2024-10-02', NULL, '16:23:22', 119, 'L'),
(603, '22842299', 'N', 'LENGUAJE : Estudiante que duerme durante todo el periodo de clases. No dessarrolla guía evaluada. Al entregarla llega y la tira sobre el escritorio del profesor, de manera despectiva, siendo una falta de respeto por parte del estudiante.', '2024-09-23', NULL, '16:26:04', 110, 'L'),
(604, '22570056', 'N', 'INGLÉS : No realiza las actividades, no copia los ejercicios , conversa en voz alta utilizando un vocabulario no apropiado para dirigirse a sus compañeros, solo se dedica a jugar con el celular.', '2024-09-27', NULL, '16:40:31', 116, 'L'),
(605, '22750648', 'N', 'LENGUAJE : El alumno no pone atención en clases y tampoco realiza la actividad señalada, solo se dedica a jugar en su celular.', '2024-09-30', NULL, '16:53:21', 115, 'L'),
(606, '22393383', 'N', 'INGLÉS : La alumna noe scribe los ejercicios dados ni realiza las actividades para ponerse al día en la materia, conversa fuerte con sus compañeros se le pide silencio no lo hace sólo juega con su celular, se le llama la atención varias veces y no entiende la situación es reiterada.', '2024-09-27', NULL, '16:59:10', 103, 'L'),
(607, '22393383', 'N', 'CS. NATURALES : Estudiante que no participa en lectura de guía de trabajo.', '2024-10-02', NULL, '17:03:10', 103, 'L'),
(608, '22318710', 'N', 'CS. NATURALES : Estudiante que no participa en lectura de guía de trabajo.', '2024-10-02', NULL, '17:03:57', 96, 'L'),
(609, '22318710', 'N', 'INGLÉS : El alumno no trae cuaderno, no escribe ni hace los ejercicios, sólo se dedica a jugar con su celular, situación reiterativa en todas las clases.', '2024-09-12', NULL, '17:08:47', 96, 'L'),
(610, '22494329', 'N', 'CS NATURALES : Estudiante que se niega a firmar lista de asistencia a charla sobre responsabilidad pensal juvenil.', '2024-09-25', NULL, '17:21:53', 90, 'L'),
(611, '22488270', 'N', 'MACE : Estudiante que toma su mochila a mitad de la clase, se acerca y dice que se retira, se le niega el permiso y él decide retirarse sin autorización.', '2024-09-23', NULL, '17:23:57', 95, 'G'),
(612, '22488270', 'O', 'INSPECTOR GENERAL : Se conversa con alumno sobre su situación y fuga de la sala de clases, se entrevista junto con la encargada de convivencia, se suspende  al alumno por irrespetuoso y fuga de la sala de clases. 5 días a contgar de mañana24.09 al 30.09 ambas fechas inclusive. Alumno se encuentra emocionalmente inestable. Se deriva a dupla para ver su situación.', '2024-09-23', NULL, '17:25:30', 95, NULL),
(613, '22488270', 'O', 'INSPECTOR GENERAL: Apoderado es citado por inspector para conversar sobre situación conductual y estado emocional. Se le informa sobre suspención de 5 días, además se le informa de la derivación a tribunales para acompañamiento a la familia. Podrá ingresar al establecimiento el día 01.10.2024', '2024-09-24', NULL, '17:39:37', 95, NULL),
(614, '22928857', 'N', 'CS NATURALES : Estudiante que no realiza nada durante la clase, dedicandose a jugar con su teléfono.', '2024-09-04', NULL, '17:44:31', 104, 'L'),
(615, '22928857', 'N', 'INGLÉS : El alumno no trae cuadenos, no escribe ni desarrolla los ejercicios dados, aún dando las respuestas, sólo se dedica a jugar con el celular y a conversar.', '2024-09-27', NULL, '17:45:38', 104, 'L'),
(616, '22928857', 'N', 'CS. NATURALES : Estudiante que no participa en lectura de guía de trabajo.', '2024-10-02', NULL, '17:50:04', 104, 'L'),
(617, '22590523', 'N', 'INGLÉS : La estudiante conversa durante toda la hora de clase como tomar jugo, comparte alimentos con su compañera \r\nYaritza B. hacen uso de celular, no escribe las actividades de la pizarra, no saca cuaderno, mantiene mochila sobre la mesa, se le llama la atención no entiende vuelve a conversar, se le advierte que saldrá de la sala, no hace caso, por el contrario saca de su mochila mas alimentos bebestibles para consumir, se le vuelve advertir que para conversar se hace en el patio, su compañera Yaritza sale y la invito a salir, ya que en el cuarto llamado de atención se le dice que comer, beber, conversar y uso de celular es en el patio. Todos estos llamados de atención perjudican el desarrollo de la clase.', '2024-10-01', NULL, '09:03:37', 160, 'L'),
(618, '22557461', 'N', 'INGLÉS : La estudiante conversa durante toda la clase, toma jugo, recibe bebestibles de su compañera Alison hace uso de celular, ve videos que le muestra a su compañera, no escribe las actividades de la pizarra, no saca cuaderno, mantiene mochila sobre la mesa, se le llama la atención, no entiende vuelve a conversar, se le advierte que de seguir saldrá de la sala, no hace caso, se le vuelve a advertir que para comer, beber y conversar se hace en el patio y la sala para poner atención, ella dice \"que no entiende\" y se le recuerda que para ella hayq ue estar atento en la clase, ya siendo este el cuarto llamado de atención, a lo que decide salir de la sala y convence a Alison de hacerlo tambien, todos estos llamados de atención interrumpen el desarrollo de la clase.', '2024-10-01', NULL, '09:11:33', 154, 'L'),
(619, '22652962', 'N', 'LENGUAJE : Estudiante que ingresa a la sala a las 16:07 hrs, a pesar del llamado de atención, se esconde haciendo caso omiso, además la estudiante durante el periodo de clases no trabaja y se dedica a peinar a su compañera Mia Espejo, demostrando ningín interés por la entrega del trabajo.', '2024-09-10', NULL, '09:20:11', 163, 'L'),
(620, '22652962', 'N', 'INSPECTOR GENERAL : Alumna no ingresa en los horarios que corresponde a la sala de clases, se queda conversando con compañera Mia Espejo, esta es una falta reiterada de la alumna, se cita apoderado para dia de mañana 11.09', '2024-09-10', NULL, '09:22:56', 163, 'L'),
(621, '22881566', 'N', 'LENGUAJE : Estudiante que duerme durante el desarrollo de la clase, mientras se trabaja en triptico, luego toma su telefono  y juega en él. Será evaluada con nota mínima al n o entregar  trabajo práctico.', '2024-09-10', NULL, '09:26:37', 167, 'L'),
(622, '22881566', 'N', 'INGLÉS : La alumna no realiza trabajo dado hace 4 clases, el cual es una evaluación, se le sugiere temática a trabajar y aún así no lo realiza, no suficiente con ello 10 minutos antes del recreo, se queda completamente dormida, se intenta despertar y no lo hace, se informa situación a profesora jefe.', '2024-09-10', NULL, '10:07:59', 167, 'L'),
(623, '22881566', 'O', 'M. JOSÉ MORALES : El padre de Martina y Daniella Campusano asiste para hablar sobre la asistencia, rendimiento y actitudes en momentos de clases. Se hace entrega de asistencia de marzo a Agosto de ambas estudiantes.\r\n\r\n*964853703  (papá)', '2024-09-10', NULL, '10:10:47', 167, NULL),
(624, '22205601', 'N', 'LENGUAJE : Estudiante que ingresa a la sala a las 16:07 hrs. Cuando la profesora pregunta por ella, se esconde y llega atrasada, mencionando que no entregará trabajo y que se evalúe con nota mínima.\r\nAl ingresar se sienta a mirar su celular junto a su compañera Mia Espejo.', '2024-09-10', NULL, '10:13:10', 161, 'L'),
(625, '22205601', 'N', 'INSPECTOR GENERAL : Estudiante no ingresa a sala de clases, cuando se le insiste contesta de mala forma y groseramente esta situación se repite todos los días y en todas las asignaturas, se citará a tutor responsable para que venga el dia de mañana.', '2024-09-10', NULL, '10:15:33', 161, 'L'),
(626, '22872452', 'O', 'INSP. GENERAL: Se conversa con apoderada sobre inasistencia y atrasos, además justifica 3 días de inasistencia, 5 al 7 septiembre. Compromiso: vendrá con Génesis a conversar sobre comportamiento.', '2024-09-06', NULL, '10:25:05', 157, NULL),
(627, '22467604', 'O', 'INSPECTOR GENERAL : Señora Juana acude al colegio a justificar inasistencia de su hija Nancy Pereira por razones que se mojó su pieza y se mojaron sus zapatos y vestimenta. Los días 10.09', '2024-09-11', NULL, '10:29:51', 156, NULL),
