(629, '22881566', 'N', 'INGLÉS : A la alumna se le llama la atención reiteradas veces  por conversar, reirese y colocar videos en el celular fuerte, se le pide bajar volumen, no entiende se le advierte que de seguir así,  deberá salir de la sala ya que interrumpe el desarrollo de ella no escribe actividades dadas, en cada llamado de atención ella se rie y sube mas el volumen del celular, se le pide salire de la sala ya que la situción es reiterativa.', '2024-10-01', NULL, '10:35:56', 167, 'L'),
(630, '22072598', 'N', 'INGLÉS : La alumna se dedica a conversar a ver videos del celular, reirese, pintarse, se le llama la atencion y no entiende, además reclama \"no estoy haciendo nada\" y continua, no pone atención a la clase continua conversando, se le vuelve a llamar la atención, tanto por profesora de asignatura como por la profesora PIE y aún así no entiende y continua haciendo interrupciones a la clase, por cada llamado de atneción y no dejando concentrarse a las compañeras interesadas en aprender.', '2024-09-27', NULL, '10:52:33', 190, 'L'),
(631, '21802822', 'N', 'INGLÉS : A la alumna se le llama la atención por conversar, reirse, ver videos en celular y además por maquillarse en la sala, no entiende y continua, se le llama la atención tanto por profesora de asignatura como por la profesora PIE, haciendo que la clase se verá interrumpida varias veces y no dejando escuchar a sus compañeras.', '2024-09-27', NULL, '11:06:21', 179, 'L'),
(632, '17716794', 'N', 'INGLÉS : A la alumna se le llama la atención varias veces ya que se dedica a conversar fuerte, reirse en voz alta, escuchar videos a volumen fuerte, se rie y grita cuando se le llama la atención a sus compañeras Dominique y Javiera, en tono de burla. la profesora PIE le llama la atención fuertemente y la alumna se rie con mas fuerza, se le advierte que de seguir asía tendrá que salir de la sala ya que tanto por la profesora de asignatura y profesora PIE se le pide guardar silencio y no lo hace interrumpiendo el buen desarrollo de la clase.', '2024-09-27', NULL, '11:09:33', 183, 'L'),
