(638, '22467604', 'O', 'PROFESORA JEFE : La madre se acerca al establecimiento para convesar sobre asistencia y notas de Nancy. Se notifica de porcentaje de asistencia (44,23%) hasta el 31-08-2024 y promedio de notas parciales. Hce entrega de certificado médico por 4 días.', '2024-10-07', NULL, '13:08:38', 156, NULL),
