(643, '21559823', 'N', 'INGLÉS: El alumno llegó a clases a las 20:01 cuando se le va a pedir pase de ingreso antes de hacerlo el contesta \"no va a pedirme pase porque no voy a ir, paseme la guía no mas\" al hacerle ver que tiene que traer, él se refiere a la persona encargada \"que voy a ir no es mi culpa que el viejo... no me de y no voy a ir a estar parado esperando el pase, así paseme la guía no mas\", todo lo dice contestando en forma prepotente y agrega \"hable con el profe Mati después no mas\"', '2024-10-15', NULL, '13:32:29', 72, 'L'),
