(683, '22878407', 'N', 'ESRUDIOS SOCIALES, JEFATURA: Estudiante que durante la clase saca cuchillo frente al docente, con el cuchillo daña la mesa de su puesto y rompe un enchufe de atrás de la sala, con el cuchillo abre un condón y lo deja en el suelo y el docente debe pararse y barrer el condón del suelo. Preocupa que el alumno ande con cuchilla y lo muestre como si nada pasara y como si no fuera peligroso; se le solicita que lo guarde y lo que hace es seguir, es expulsado de la sala de clases. No escribe nada solo se dedica a dañar la sala de clases con un cuchillo.', '2024-10-23', NULL, '12:38:32', 101, 'G'),
(684, '22878407', 'O', 'INSPECTOR GENERAL: Se toma conocimiento de la anotación del profesor jefe David Guajardo y sobre la anotación de tenencia y porte de arma blanca . Segun RICE en el apartado falta Gavisima Punto 3 uso porte objeto corto punzantes, se procede a suspención de clases por 5 días hábiles. Se llamará apoderado para notificación de la suspención y se dispondrá la intervención del equipo psicosocial y posible aplicación de aula segura.\r\n15:44 no se ha podido, Padre puede venir el lunes 28.10 durante la mañana, sólo en ese momento se aplicará sanción.', '2024-10-24', NULL, '13:23:01', 101, NULL),
(685, '21826761', 'N', 'Matemática: Estudiante se niega a rendir disertación que corresponde a la segunda evaluación del segundo semestre, obteniendo la nota mínima. Además, mientras su compañero David expone, lanza un papel al basurero, cuando se corrige su actitud menciona : \"Estoy no ahi\"', '2024-10-16', NULL, '11:01:44', 148, 'L'),
(686, '21053735', 'O', 'CONVIVENCIA ESCOLAR: Estudiante ha incumplido las fechas de los trabajos \"Proyecto comunitario\" con fecha 21/10 a las 12:00 y \"Proyecto after school\" con fecha 22/10 a las 00:00.\r\nLa estudiante se compromete a entregar ambos trabajos hasta el día 04/11 a las 23:00 hrs, con nota máxima 5.0 y 70% de exigencia según reglamento de evaluación.', '2024-10-29', NULL, '11:07:15', 198, NULL),
(687, '21867781', 'O', 'MATEMÁTICA: Estudiante ha incumplido las fechas de los trabajos \"Proyecto comunitario\" con fecha 21/10 a las 12:00 y \"Proyecto affter school\" con 22/10 a las 23:00. La estudiante se compromete a entregar ambos trabajos haste el día 04/11 a las 23:00 hrs, con nota máxima 5.0 y 70% de exigencia según reglamento de evaluación.', '2024-10-30', NULL, '11:16:29', 193, NULL),
(688, '21553972', 'O', 'CONVIVENCIA ESCOLAR: Estudiante ha incumplido los plazos de los trabjados \"Proyecto comunitario\" con fecha lunes 21 hasta las 12;20 y \"proyecto aftershool\" con fecha 22/10 a las 00:00. La estudiante se compromete a entregar ambos trabajos hasta el día lunes 04/11 a las 23:00 con nota máxima 5.0 y 70% de exigencia, según reglamento de evaluación,', '2024-10-29', NULL, '11:20:04', 194, NULL),
(689, '21553972', 'O', 'PROFESORA JEFE: En el momento de la entrevista, la apoderada realiza llamada a la sicóloga de la residencia, quien mediante altavoz explica que la estudiante presenta cuadro depresivo desde principios de año y que estaría llevando un esquema farmacológico que cumple responsablemente. Se le informa a la apoderada y se pone en antecedente que la alumna menciona estar siendo molestada por las compañera sde la residencia. Además se dialóga y se informa sobre la situación pedagógica de la estudiante y su buen compromiso académico. Se conversa con la apoderada sobre la situación socio-emocional de la estudiante y la falta de motivación que está prfesentando dujrante este semestre. Se le menciona a la apoderada que estudiante ha mencionado estar muy angustiada por tener que abandonar la residencia al cumplir mayoría de edad', '2024-10-24', NULL, '11:24:43', 194, NULL),
(690, '22881566', 'O', 'La estudiante se compromete a rendir prueba escrita el día lunes 04/10. De no asistir se calificará con nota 1.0.', '2024-10-29', NULL, '11:42:33', 167, NULL),
(691, '22881581', 'O', 'MATERIAL DIDÁCTICO: La estudiante debe presentar material didáctico correspondiente a la nota 3 el día lunes 04/11. De no cumplir se calificará con nota 1.0', '2024-10-29', NULL, '11:44:37', 166, NULL),
(692, '22590523', 'N', '´MATERIAL DIDÁCTICO : La estudiante comenta que no realiza trabajo que corresponde a la tercera nota y señala que \"no lo hice ni lo voy hacer\". Se le pregunta los motivos y no los expone. Se califica con nota mínima 1.0', '2024-10-28', NULL, '11:45:57', 160, 'L'),
(693, '22881566', 'O', 'MATERIAL DIDÁCTICO: La estudiante se compromete a traer material didáctico pendiente el día miércoles 29/10. De no presentarlo se calificará con nota 1,0 (Panel de asistencia + material que estimula sentidos),', '2024-10-29', NULL, '11:48:00', 167, NULL),
(694, '22652962', 'O', 'MATERIAL DIDÁCTICO : La estudiante se compromete a entregar los 3 trabajos pendientes el día lunes  11 de noviembre. Dere no cumplir de calificará con nota 1.0', '2024-11-04', NULL, '11:51:29', 163, NULL),
(695, '22652962', 'O', 'ACTIVIDADES EDUCATIVAS : La estudiante se compromete a rendir prueba escrita el martes 12 de noviembre. De no asistir se calificará con nota 1,0', '2024-11-04', NULL, '11:59:44', 163, NULL),
(696, '22245001', 'N', 'INSTALACIONES : Estudiante no trabaja en clases prácticas realizando  TDA y medidas por tanto al momento de la evaluación  no la quiere dar es calificado con nota mínima.', '2024-10-03', NULL, '12:11:33', 128, 'L'),
(697, '22245001', 'N', 'INSTALACIONES : Estudiante no quiere realizar la evaluación práctica a pesar que se le dio mas tiempo que al resto de sus compañeros y de todas formas no trabajó en clases (atrasada)', '2024-09-26', NULL, '12:18:24', 128, 'L'),
(698, '22245001', 'N', 'DOMCE: ERstudiante después de varias clases de inasistencia de la evaluación que tendr´pia que haber dado el 27-09 se le pregunta si va a realizar las evalauciones prácticas , su respuesta es no, por tanto se evalúa con nota mínima.', '2024-10-24', NULL, '12:20:01', 128, 'L'),
(699, '22558504', 'N', 'INSTALACIÓN ELÉCTRICA: Estudiante no da la evaluación práctica de ctos a pesar que se le dio mucho tiempo para practicar y no lo hacía, por tanto es calificado con nota mínima.', '2024-09-26', NULL, '12:21:51', 8, 'L'),
(700, '22558504', 'N', 'INSTALACIÓN ELÉCTRICA : A pesar que se le dio el tiempo sificiente en clase para practicar y no lo realizó ninguna de las clases\r\npor tanto cuando se le preguntó para que realizara la evaluación práctica se negó por tanto se califica con nota mínima.', '2024-10-03', NULL, '12:23:31', 8, 'L'),
(701, '22558504', 'N', 'DOMCE: Estudiante no realiza las evaluaciones prácticas ya que cuando viene a trabajar en clases está tgoda la hora con su celular  y a pesar que se le solicita que realice las actividades de la clase n o lo hace por tanto cuando se le solicita que de las evaluaciones prácticas atrasadas y la que corresponde, no la realiza evaluandolo con la nota mínima.', '2024-10-04', NULL, '12:25:33', 8, 'L'),
(702, '22318710', 'O', 'INSPECTOR GENERAL: La señora Marisol Gutierrez se entrevista con Inspector general sobre la suspención de su pupilo.', '2024-10-09', NULL, '12:33:08', 96, NULL),
(703, '22494329', 'N', 'Inglés ; El alumno ingresa a clases a las 9:55 y se sienta a conversar con su compañero, se le pide que escriba la actividad proyectado o tendrá que quedarse todo el bloque de clases, a lo que el responde \"chupame el pico\", además ingresa sin pase autorización.', '2024-11-05', NULL, '13:24:23', 90, 'G'),
(704, '22878407', 'N', 'CS. NATURALES: Estudiante que enciende pelusas que caen d elos árboles en mesa del profesor usando encendedor y diciendo \"ahí tiene una reacción química\",', '2024-10-30', NULL, '13:30:22', 101, 'L'),
(705, '22878407', 'N', 'ESTUDIOS SOCIALES: Estudiante que nuevamente saca el enecendedor, prende fuego y pega el palo de coyak a la mesa, el docente le dice que deje hacer esto y el alumno dice \"El lunes viene mi papá. en 10 días más vuelvo, yo no amenazo\", a lo que el docente le dice \"Me estás amenazando, el alumno: ¡No amenazo¡ este estudiante incumple las normas del colegio, debe irse suspendido y que se le aplique el Aula segura, ya que anda con cuchillo y prende fuego en la sala. Murmura en tono de amenaza que dejara la grande cunado vuelva, tono de amenaza al docente. El docente le dice que él no le tiene miedo a nadie y menos a él al escuchar las amenzas. NO HACE NADA EN CLASES, pero paradañar el inmueble tiene tiempo de sobra.', '2024-11-07', NULL, '12:08:19', 101, 'L'),
(706, '22878407', 'O', 'DIRECTOR/ INSP. GRAL SUPLENTE/ECARGADA CONVIVENCIA: Don Segundo Monroy acude al establecimiento a tomar conocimiento del comportamiento y de las anotaciones de Alexis y suspensión por 5 días según Reglamento. Desde el 11 hasta el 15, ambas fechas inclusive.', '2024-11-11', NULL, '12:20:00', 101, NULL),
(707, '100720716', 'O', 'LENGUAJE: Alumno entrega prueba con solo 2 respuestas, se evaluas y obtiene nota 1.9', '2024-11-05', NULL, '12:13:13', 7, NULL),
(708, '100720716', 'O', 'LENGUAJE: Se le aviosa al alumno que se  volverá a tomar la prueba del 1,9  el día lunes', '2024-11-08', NULL, '12:15:17', 7, NULL),
(709, '100720716', 'O', 'LENGUAJE : Por tiempo no alcanza a tomar la prueba y queda con permiso para rendir la prueba mañana martes 12', '2024-11-13', NULL, '12:18:28', 7, NULL),
(710, '100720716', 'O', 'LENGUAJE : Alumno no se presenta a rendir la prueba, se coloca la n ota anterior 1,9', '2024-11-13', NULL, '12:22:45', 7, NULL),
(711, '16241682', 'N', 'PROFESORA JEFE : Alumna que entrega prueba de estudios sociales en blanco , se le da opción que saque el  cuaderno y se ayuda con el para responder la prueba y se niega , dice : no pa que no quiero hacer nada, coloque el 2,0 no me importa,', '2024-10-07', NULL, '12:24:00', 14, 'L'),
(712, '16241682', 'O', 'PROFESOR JEFE : La estudiante debía presentar el himno nacional escrito en cartulina, no lo trajo, dice que el tío tuvo que salir y no lo pudi hacer, se le da último plazo para mañana martes y dice que no lo traerá que ya se sacó un 2,0 y que le da lo mismo, de todos modos se esperará hasta mañana con el trabajo.', '2024-10-07', NULL, '12:34:19', 14, NULL),
(713, '16241682', 'O', 'PROFESOR JEFE: Alumna llega sin su trabajo, se llama por celular al tío y se le explica la situación, él manifiesta que conversará con la estudiante, es evaluada con nota mínima.', '2024-10-08', NULL, '12:55:29', 14, NULL),
(714, '22733775', 'N', 'OFICIO : Estudiante le grita en la sala de taller a un extranjero moreno (jazón) te gusta el café con leche aludiendo a su color de piel. Se le llama la atención y se conversa con el estudiante.', '2024-10-15', NULL, '12:58:14', 8, 'L'),
(715, '22733775', 'O', 'PROFESORA JEFE : Alumno no presenta los trabajos pendientes y no rinde pruebas pen dientes, se niega a darlas es evaluado con nota mínima.', '2024-11-05', NULL, '13:04:10', 8, NULL),
(716, '22733775', 'O', 'PROFESORA JEFE: Entrega prueba en blanco es evaluadao con nota mínima (la pelicula se vio en clases y se leyó el libro)', '2024-11-05', NULL, '13:05:27', 8, NULL),
(717, '22781695', 'O', 'PROFESORA JEFE : Se le da último plazo para mañana miercoles 30 de octubre para dar notas pendientes  si no cumple será evaluada con nota mínina.', '2024-10-29', NULL, '13:13:32', 10, NULL),
(718, '22781695', 'O', 'PROFESORA JEFE : Alumno que se presenta sin sus trabajos, no rinde las pruebas pendientes, es evaluado con nota mínima.', '2024-10-30', NULL, '13:16:03', 10, NULL),
(719, '22781695', 'O', 'PROFESOR JEFE : Entrega prueba en blanco, es evaluado con nota mínima.', '2024-11-05', NULL, '13:17:19', 10, NULL),
(720, '22781695', 'N', 'PROFESOR JEFE : Sale sin permiso de la sala para el baño, cuando llega se le llama la atención y responde que si esta solo en sala por eso salio', '2024-11-05', NULL, '13:20:46', 10, 'L'),
(721, '22781695', 'O', 'PROFESORA JEFE : Alumno debía venir a rendir notas pendientes en lenguaje prueba de libro y no asiste', '2024-11-08', NULL, '13:22:56', 10, NULL),
(722, '23169088', 'O', 'OFICIO : Estudiante se lleva trabajo práctico con seguimiento de proceso de circuitos 9/15 - 9/24 - 9/32 y plomo eléctrico se le entrega borrador con plazo el día martes 19 de noviembre 2024 como plazo máximo.', '2024-11-12', NULL, '13:25:03', 2, NULL),
(723, '22775021', 'N', 'ESTUDIOS SOCIALES : Alumno que no escribe, se dedica solo a estar en su celular en clases y conversr en la sala.', '2024-10-14', NULL, '13:29:01', 6, 'L'),
(724, '22775021', 'N', 'C. NATURALES : Alumno que no trabaja en clases, se le pide que escriba pero él conversa con David y jueg en su celular.', '2024-11-05', NULL, '13:31:07', 6, 'L'),
(725, '22775021', 'O', 'LENGUAJE : Alumno que entrega prueba en blanco es evaluado con nota mínima.', '2024-11-05', NULL, '13:32:24', 6, NULL),
(726, '22775021', 'O', 'LENGUAJE : Alumno entrega prueba en blanco, es evaluado con nota mínima 1.0', '2024-11-12', NULL, '13:33:44', 6, NULL),
(727, '22775021', 'O', 'PROFESORA JEFE : Apoderado asiste a reunión.', '2024-10-01', NULL, '13:34:26', 6, NULL),
(728, '22775021', 'O', 'Insp. Gral SUPLENTE : Apoderado don Ángel Canales asiste a tomar conocimiento de suspensión de Javier por 5 días, debido a fuga del estblecimeinto el día 12/11. Suspensión desde el 13 hasta el 19 noviembre, ambas fechas inclusive', '2024-11-13', NULL, '13:35:09', 6, NULL),
(729, '22837861', 'O', 'INSPECTOR GENERAL : Se cita a residencia para explicar la situación ocurrida con Jazmín y a la vez notificar que será activado el protocolo de trafico de drogas según RICE, se informa suspensión por 5 días hábiles, desde jueves 03 de octubre al 09 de octubre.', '2024-10-02', NULL, '13:37:34', 11, NULL),
(730, '22837861', 'O', 'PROFESORA JEFE : Hoy vuelve la estudiante de su suspensión. Según compromiso del día 02/10 se le tomará pruebas pendientes esta semana, hoy se le entrega \"prueba de lenguaje\" y de \"Historia\" y la entrega en blanco, dice que no estudió y se le olvidó, es evaluada con notya mínima.', '2024-10-10', NULL, '13:40:30', 11, NULL),
(731, '22837861', 'N', 'PROFESOR JEFE : Alumna sale de la sala con mochila diciendo que se va, se le pide que vuelva y que no puede salir sin permiso, dice que no le importa y sale de igual forma.', '2024-10-10', NULL, '13:43:11', 11, 'G'),
(732, '22781695', 'O', 'LENGUAJE : Alumno que no rinde prueba de lenguaje tomada la semana pasada, se esperará hsta mañana para que la rinda.', '2024-11-11', NULL, '13:44:58', 10, NULL),
(733, '22781695', 'O', 'ESTUDIOS SOCIALES : Alumno que no presenta su cuaderno para revisión, se avisó la semana pasada en forma presencial a los estudiantes y se recordó durante toda la semana a través del whatsaap de aviso, también se avisó con fecha 4 de noviembre a los apoderados através de whatsaap de apoderados. El alumno llegó sin su cuaderno es evaluado con nota mínima. Mñana se revisrá cuaderno de lenguaje y cs. naturales, miercóles de matemáticas, se volvió a recordar al estudiante, prueba de lenguaje.', '2024-11-11', NULL, '13:46:18', 10, NULL),
(734, '22781695', 'O', 'PROFESOR JEFE : Alumno que no se presenta a rendir notas pendientes de P. Lenguaje que se tomó el 08/11 y revisión de cuadernos.', '2024-11-12', NULL, '15:29:37', 10, NULL),
(735, '22781695', 'O', 'PROFESOR JEFE : Alumno no se presenta a mostrar cuaderno para revisión, habeindo quedado en compromiso, es evaluado con nota mínima.', '2024-11-13', NULL, '15:41:32', 10, NULL),
(736, '14573326', 'N', 'INGLÉS (EDUCADORA DIFERENCIAL) : A la estudiante Gladys Vallejos se le hace entrgea de guía evaluada al igual que al resto de sus compañeras, ya que por falta de tiempo no fue terminada en la clase anterior. La profesora de la asignatura se encuentra con permiso, por lo qur tomo el curso, doy las instrucciones y en ese mismo momento la estudiante comienza a reclamar en un tono de voz alto, que a ella nadie la ayuda, menciona que para que estamos los profesores y cada vez sube mas el tono, se le solicita que se calme y que baje un poco el volumen, se le explica que se ayuda a todos por igual, perro no deja hablar porque sube mas su voz. \r\nLe hago saber que si la ayudo y muchas veces es su actitud frente a lo académico lo que le impide que adquiera aprendizajes (comportamiento). Continua reclamando, pero en contra de su compañera Rosa Contreras, se le pide de forma respetuosa qjue se calme y baje la voz, que respete a todas sus compañeras que están siendo evaluadas y que se converse en l', '2024-11-15', NULL, '16:37:34', 25, 'L'),
